import React from 'react';
import './product-checkout.styles.css';
import { DeleteOutlined, CaretUpOutlined, CaretDownOutlined } from '@ant-design/icons';
import { Button } from 'antd';
import ProductItem from '../product-item/product-item.component';

const ProductCheckOut = () => (
  <div className="product-container">
    <ProductItem />

    <div className="product-quantity">
      <CaretDownOutlined style={{ fontSize: '20px' }} />
      <span style={{ fontSize: '20px' }}>3</span>
      <CaretUpOutlined style={{ fontSize: '20px' }} />
    </div>
    <div className="product-delete">
      <Button type="primary" icon={<DeleteOutlined style={{ fontSize: '24px' }} />} />

    </div>
  </div>
);
export default ProductCheckOut;
